The 2001 Real Music Sampler.

Real Music is a New Age label, this disc contains nine tracks from popular Real Music Artists.

FLAC

1. Bernard L'Hoir - &quot;Little Sydney&quot;

2. Karunesh - &quot;Moon Temple&quot;

3. Hilary Stagg - &quot;Sweet Return&quot;

4. David London - &quot;Capture The Moment&quot;

5. Govi - &quot;Tears Of Joy&quot;

6. Danny Wright - &quot;Angel Voices&quot;

7. 2002 - &quot;The Sea At Night&quot;

8. Kevin Kern - &quot;Above The Clouds&quot;

9. Johannes Linstead - &quot;Guitar Of Fire&quot;


All MP3 tracks have ID3 tags for Album, Artist, Track Titles, and order in the album.  Some other information, such as Year, Genre, and Publisher may have been added if the information was available to me.

FLAC cannot be encoded in a usable fashion with tags, so you must add them yourself. 

All albums will have album art included if it was available to me.

All MP3 files that I upload are encoded at TRUE 320 kbps.

All FLAC files that I upload are encoded at highest quality.  If the files seem a little large, that is why. 

